ALTER TABLE test_message ADD COLUMN prep_message_original_response TEXT;
ALTER TABLE test_message ADD COLUMN result_store_status VARCHAR(250);

CREATE TABLE transport_analysis (
  transport_analysis_id          INTEGER NOT NULL AUTO_INCREMENT PRIMARY KEY,
  connection_label               VARCHAR(250) NOT NULL,
  transport_type                 VARCHAR(250) NOT NULL,
  analysis_notes                 TEXT,
  report_complete                VARCHAR(250)
);

CREATE TABLE transport_wsdl_cdc (
  transport_wsdl_cdc_id          INTEGER NOT NULL AUTO_INCREMENT PRIMARY KEY,
  transport_analysis_id          INTEGER NOT NULL,
  transport_status               VARCHAR(250),
  transport_notes                TEXT,
  pass_eye_test                  VARCHAR(250),
  client_certificate             VARCHAR(250),
  ct_supports                    VARCHAR(250),
  ct_conforms                    VARCHAR(250),
  ct_failure_reason              TEXT,
  ssm_supports                   VARCHAR(250),
  ssm_conforms                   VARCHAR(250),
  ssm_failure_reason             TEXT,
  sf_supports                    VARCHAR(250),
  sf_conforms                    VARCHAR(250),
  sf_failure_reason              TEXT
);

CREATE TABLE transport_other (
  transport_other_id             INTEGER NOT NULL AUTO_INCREMENT PRIMARY KEY,
  transport_analysis_id          INTEGER NOT NULL,
  client_certificate             VARCHAR(250),
  operation                      VARCHAR(250),
  username                       VARCHAR(250),
  password                       VARCHAR(250),
  facilityid                     VARCHAR(250),
  other_parameter                VARCHAR(250),
  hl7_message                    VARCHAR(250),
  could_use_cdc_wsdl             VARCHAR(250),
  findings_report                VARCHAR(250)
);









